#!/usr/bin/env python3
import os, sys, base64, tempfile, subprocess
from Crypto.Cipher import AES
C=''; T='lYOvNBV3VgreHMBSsFs2Pg=='; N='xLVKZPN0cQ5UtaLb'; K='3vhbf8pUkA/pE6cSIDpNcdtHOkelBTxae3jZwwJsXCg='; is_py=False
key=base64.b64decode(K)
cipher=AES.new(key,AES.MODE_GCM,nonce=base64.b64decode(N))
plain=cipher.decrypt_and_verify(base64.b64decode(C),base64.b64decode(T))
with tempfile.NamedTemporaryFile(delete=False) as tf:
    tf.write(plain); tf.flush()
    os.chmod(tf.name,0o755)
    exe=[sys.executable if is_py else '/bin/bash', tf.name]
    subprocess.run(exe+sys.argv[1:])
    os.unlink(tf.name)
